// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.4.22 <0.9.0;

contract Voting{
    /*✅ 创建一个名为Voting的合约，包含以下功能：
        一个mapping来存储候选人的得票数
        一个vote函数，允许用户投票给某个候选人
        一个getVotes函数，返回某个候选人的得票数
        一个resetVotes函数，重置所有候选人的得票数
    */
    // 存储候选人的得票数
    mapping(address => uint56) private candidate;
    mapping(address => bool) private voter;
    address[] private voters;
    address[] private candidates;
    //用户投票给某个候选人
    function vote(address _candidate) public returns (bool) {
        require(!voter[msg.sender], unicode"您已经投过票了！");
        //记录投票记录
        voter[msg.sender] = true;
        voters.push(msg.sender);
        //增加候选人投票数量
        candidate[_candidate]++;
        candidates.push(_candidate);
        return true;
    }
    //获取某个候选人的得票数
    function getVotes(address _candidate) public view returns (uint56) {
        return candidate[_candidate];
    }
    //重置所有候选人的得票数
    function resetVotes() public returns (uint256,uint256) {
        uint256 value1 = 0;
        uint256 value = 0;
        for (uint i=0;i<candidates.length;i++) {
            //重置当前候选人的得票数
            value1 = candidate[candidates[i]];
            candidate[candidates[i]] = 0 ;
            value = candidate[candidates[i]];
        }
        for (uint i=0;i<voters.length;i++) {
            //重置当前投票人
            voter[voters[i]] = false;
        }
        delete candidates;
        delete voters;
        return (value1,value);
    }
    
}

